import React from 'react';

import { BrowserRouter, Route } from 'react-router-dom';
import Login from './pages/Login';
import InfoUser from './pages/InfoUser';
import WorkStationsList from './pages/WorkStationList';
import WorkStationDetail from './pages/WorkStationCRUD';
import WorkStationCRUD from './pages/WorkStationCRUD';

function Routes() {
  return (
    <BrowserRouter>
      <Route path="/" component={Login} exact />
      <Route path="/editing-user" component={InfoUser} />
      <Route path="/workstation" component={WorkStationCRUD} exact />
      <Route path="/workstations/list" component={WorkStationsList} />
      <Route path="/workstation" component={WorkStationDetail} />
    </BrowserRouter>
  );
}

export default Routes;
